import { observe } from 'mobx';
import '../CSS/main.css'

function CountMakeObservable({store}) {
    return (
        <>
        <div  class = "example">
        <div >{store.count}</div>
        </div>
        </>
    )
}

export default observer(CountMakeObservable);
